{
  "ubx_message_extraction": {
    "name": "UBX-NAV-TIMELS",
    "class_id": "0x01",
    "message_id": "0x26",
    "message_type": "periodic_polled",
    "description": "Information about the upcoming leap second event if one is scheduled.",
    "payload_length": {
      "fixed": 24
    },
    "payload": [
      {
        "byte_offset": 0,
        "name": "iTOW",
        "data_type": "U4",
        "unit": "ms",
        "description": "GPS time of week of the navigation epoch. See section iTOW timestamps in the integration manual for details."
      },
      {
        "byte_offset": 4,
        "name": "version",
        "data_type": "U1",
        "description": "Message version (0x00 for this version)"
      },
      {
        "byte_offset": 5,
        "name": "reserved0",
        "data_type": {
          "array_of": "U1",
          "count": 3
        },
        "reserved": true,
        "description": "Reserved"
      },
      {
        "byte_offset": 8,
        "name": "srcOfCurrLs",
        "data_type": "U1",
        "description": "Information source for the current number of leap seconds.\n• 0 = Default (hardcoded in the firmware, can be outdated)\n• 1 = Derived from time difference between GPS and GLONASS time\n• 2 = GPS\n• 3 = SBAS\n• 4 = BeiDou\n• 5 = Galileo\n• 6 = Aided data\n• 7 = Configured\n• 8 = NavIC\n• 255 = Unknown"
      },
      {
        "byte_offset": 9,
        "name": "currLs",
        "data_type": "I1",
        "unit": "S",
        "description": "Current number of leap seconds since start of GPS time (Jan 6, 1980). It reflects how much GPS time is ahead of UTC time. Galileo number of leap seconds is the same as GPS. BeiDou number of leap seconds is 14 less than GPS. GLONASS follows UTC time, so no leap seconds."
      },
      {
        "byte_offset": 10,
        "name": "srcOfLsChange",
        "data_type": "U1",
        "description": "Information source for the future leap second event.\n• 0 = No source\n• 2 = GPS\n• 3 = SBAS\n• 4 = BeiDou\n• 5 = Galileo\n• 6 = GLONASS\n• 7 = NavIC"
      },
      {
        "byte_offset": 11,
        "name": "lsChange",
        "data_type": "I1",
        "unit": "S",
        "description": "Future leap second change if one is scheduled. +1 = positive leap second, -1 = negative leap second, 0 = no future leap second event scheduled or no information available."
      },
      {
        "byte_offset": 12,
        "name": "timeToLsEvent",
        "data_type": "I4",
        "unit": "S",
        "description": "Number of seconds until the next leap second event, or from the last leap second event if no future event scheduled. If > 0 event is in the future, = 0 event is now, < 0 event is in the past. Valid only if validTimeToLsEvent = 1."
      },
      {
        "byte_offset": 16,
        "name": "dateOfLsGpsWn",
        "data_type": "U2",
        "description": "GPS week number (WN) of the next leap second event or the last one if no future event scheduled. Valid only if validTimeToLsEvent = 1."
      },
      {
        "byte_offset": 18,
        "name": "dateOfLsGpsDn",
        "data_type": "U2",
        "description": "GPS day of week number (DN) for the next leap second event or the last one if no future event scheduled. Valid only if validTimeToLsEvent = 1. (GPS and Galileo DN: from 1 = Sun to 7 = Sat. BeiDou DN: from 0 = Sun to 6 = Sat.)"
      },
      {
        "byte_offset": 20,
        "name": "reserved1",
        "data_type": {
          "array_of": "U1",
          "count": 3
        },
        "reserved": true,
        "description": "Reserved"
      },
      {
        "byte_offset": 23,
        "name": "valid",
        "data_type": "X1",
        "description": "Validity flags",
        "bit_fields": [
          {
            "name": "validCurrLs",
            "position": 0,
            "length": 1,
            "description": "1 = Valid current number of leap seconds value."
          },
          {
            "name": "validTimeToLsEvent",
            "position": 1,
            "length": 1,
            "description": "1 = Valid time to next leap second event or from the last leap second event if no future event scheduled."
          }
        ]
      }
    ]
  }
}
